const icon = 'data:image/svg+xml;base64,';
class cloudlink {
  constructor() {}
  getInfo() {
    return {
      id: 'cloudlink',
      name: 'CloudLink',
      color1: '#054c63',
      color2: '#054c63',
      color3: '#043444',
      blockIconURI: icon,
      blocks: [
        {
          opcode: 'get',
          blockType: Scratch.BlockType.REPORTER,
          text: 'Get from websocket [A]',
          arguments: {
            A: {
              type: Scratch.ArgumentType.STRING,
              defaultValue: '127.0.0.1:3000',
            },
          },
        },
      ],
    }
  }
  get({A}) {
    return A;
  }
}
Scratch.extensions.register(new cloudlink())
